import React, { useState } from 'react';

const Contact =()=>{
  const[data, setData]=useState({
    fullname:"",
    phone:"",
    email:"",
    message:"",
  });

  const InputEvent=(event)=>{
    const {name, value} =event.target;
    setData((preVal)=>{
      return{
        ...preVal,[name]:value, 
      }
    });
  }
const formSubmit=(e)=>{
  e.preventDefault();


}

  return(<>
  <div className="my-4">
    <h1 className="text-center"> Contact us</h1>
    <hr className="w-25 mx-auto"></hr>
  </div>

  <div className="container contact-div">
    <div className="row">
      <div className="col-md-6 col-10 mx-auto">
        <form onSubmit={formSubmit}>
        <div class="mb-3">
  <label for="exampleFormControlInput1" class="form-label">Full Name</label>
  <input type="text" class="form-control" id="exampleFormControlInput1" name="fullname" value={data.fullname} onChange={InputEvent} placeholder="Enter your Full Name" />
</div>
  <div class="mb-3">
  <label for="exampleFormControlInput1" class="form-label">Mobile No</label>
  <input type="number" class="form-control" id="exampleFormControlInput1" name="mobile" value={data.mobile} onChange={InputEvent} placeholder="Mobile-No" />
</div>
  <div class="mb-3">
  <label for="exampleFormControlInput1" class="form-label">Email address</label>
  <input type="email" class="form-control" id="exampleFormControlInput1" name="email" value={data.email} onChange={InputEvent} placeholder="name@example.com" />
</div>
  
<div class="mb-3">
  <label for="exampleFormControlTextarea1" class="form-label">Message</label>
  <textarea class="form-control" id="exampleFormControlTextarea1" rows="3" name="message" value={data.message} onChange={InputEvent} placeholder="Enter Your Message"></textarea>
</div>
<div class="col-12 mb-3 text-center">
    <button class="btn btn-outline-success" type="submit">Submit</button>
  </div>
        </form>
      </div>
    </div>
  </div>
  </>);
}

export default Contact;
